class Prayer_Global_Add extends DT_Magic_Url_Base
{
    public $page_title = 'Prayer.Global';
    public $root = 'add';
    public $type = 'records';
    public $url_token = 'add/records';
    public $type_name = 'Newest Lap';
    public $post_type = 'contacts';

    private static $_instance = null;
    public static function instance() {
        if ( is_null( self::$_instance ) ) {
            self::$_instance = new self();
        }
        return self::$_instance;
    } // End instance()

    public function __construct() {
        parent::__construct();

        $url = dt_get_url_path();

        if ( substr( $url, 0, strlen( $this->url_token ) ) !== $this->root . '/' . $this->type ) {
            return;
        }

        $this->redirect();
    }

    public function redirect() {
        // @phpcs:disable
        require_once( trailingslashit( plugin_dir_path( __DIR__ ) ) . 'pages/pray/stacker.php' );
        global $wpdb;
        $start =2;
        if ( isset( $_GET['start'] ) ) {
            $start = $_GET['start'];
        }

        $raw_list = $wpdb->get_col(
            "SELECT
                        lg1.grid_id
                    FROM $wpdb->dt_location_grid lg1
                    WHERE lg1.level = 0
                      AND lg1.grid_id NOT IN ( SELECT lg11.admin0_grid_id FROM $wpdb->dt_location_grid lg11 WHERE lg11.level = 1 AND lg11.admin0_grid_id = lg1.grid_id )
                      AND lg1.admin0_grid_id NOT IN (100050711,100219347,100089589,100074576,100259978,100018514)
                    UNION ALL
                    SELECT
                        lg2.grid_id
                    FROM $wpdb->dt_location_grid lg2
                    WHERE lg2.level = 1
                      AND lg2.admin0_grid_id NOT IN (100050711,100219347,100089589,100074576,100259978,100018514)
                    UNION ALL
                    SELECT
                        lg3.grid_id
                    FROM $wpdb->dt_location_grid lg3
                    WHERE lg3.level = 2
                      AND lg3.admin0_grid_id IN (100050711,100219347,100089589,100074576,100259978,100018514)"
        );
        $inc = 0;
        $current_lap = pg_current_global_lap();
        $post_id = $current_lap['post_id'];
        if ( isset( $_GET['post_id'] ) ) {
            $post_id = $_GET['post_id'];
        }
        foreach ( $raw_list as $grid_id ) {
            if ( $inc > $start ) {
                $user = $this->random_items();
                $lng = $user['lng'];
                $lat = $user['lat'];
                $level = $user['level'];
                $label = $user['label'];
                $timestamp = time();
                $hash = hash( 'sha256', mt_rand( 0, 200 ) );
                $wpdb->query( "INSERT INTO $wpdb->dt_reports( post_id, post_type, value, type, subtype, grid_id, timestamp, hash, lng, lat, label )
                VALUES( $post_id, 'laps', 1, 'prayer_app', 'global', $grid_id, $timestamp, '$hash', $lng, $lat, '$label' );" );
            }
            $inc++;
        }
    }

